package com.smile.model;import jakarta.persistence.Entity;import jakarta.persistence.GenerationType;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import java.time.LocalDateTime;import java.util.List;@Entity@AllArgsConstructor@NoArgsConstructor@Getter@Setterpublic class Survey {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Long id;    private String batchNumber;    private String title;    @OneToMany(cascade = {CascadeType.PERSIST, CascadeType.MERGE}, fetch = FetchType.LAZY)    private List<Questions> listOfQuestions;    private LocalDateTime timeCreated;    private LocalDateTime timeTaken;    @Override    public String toString() {        return "Survey{" +                "id=" + id +                ", title='" + title + '\'' +                ", question='" + listOfQuestions + '\'' +                ", timeCreated=" + timeCreated +                ", timeTaken=" + timeTaken +                '}';    }}